import React from 'react';
import { Card } from "react-bootstrap";

class Home extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <Card style={{ color: "black", width: "18rem" }}>
                <Card.Header>Classy Bank Landing Module</Card.Header>
                <Card.Img variant="top" src={"./public/bank.png"} alt="Responsive image" className="img-fluid"/>
                <Card.Body>
                    <Card.Title>Welcome to the Bank</Card.Title>
                    <Card.Text>
                        You can move around using the navigation bar.
                    </Card.Text>
                </Card.Body>
            </Card>
        );
    }
}

export default Home;
